void fill_blank(int L[],int output[],int rel[])
{
  int i,j,c0,c1,cr;

  for(i=0;i<N;i++)
    {
      c0=c1=0;
      for(j=i;j<i+M;j++)
	{
	  if(output[j]==0)
	    c0++;
	  else if(output[j]==1)
	    c1++;
	}
      cr=M-c0-c1;
      if(rel[i]!=-1 && output[i]!=-1)
	fil_rel(output,rel,rel[i],output[i]);

      if(cr==0)
	goto LOOPEND;
      if(c1==L[i])
	{
	  for(j=i;j<i+M;j++)
	    if(output[j]!=1)
	      output[j]=0;
	}
      else if(c1+cr==L[i] && cr>0)
	{
	  for(j=i;j<i+M;j++)
	    if(output[j]!=0)
		output[j]=1;
	}
      else if(c1+cr < L[i])
	{
	  errno=5;errpos=i;
	  longjmp(jb,1);
	}
      else if(c0+cr < M-L[i])
	{
	  errno=6;errpos=i;
	  longjmp(jb,1);
	}
    LOOPEND:
      ;
    }
}
